import React from 'react';
import { createContext } from 'react';
import ReactDOM from 'react-dom/client';

import App from './App';

import './index.css';

import { PostStorage } from './storage/PostStore';
import { UserStorage } from './storage/UserStore';
import { GroupStorage } from './storage/GroupStore';
import { FriendStorage } from './storage/FriendStore';

const root = ReactDOM.createRoot(document.getElementById('root'));
export const Context = createContext(null)

root.render(
  <React.StrictMode>
    <Context.Provider value={{
      groupStorage: new GroupStorage(),
      userStorage: new UserStorage(),
      postStorage: new PostStorage(),
      friendStorage: new FriendStorage()
    }}>
      <App />
    </Context.Provider>
  </React.StrictMode>
);
